export default class Prediction extends React.Component {
  constructor(props) {
    super(props);
    this.state = {data: DATA};
  }

  componentWillMount() {
    // if (this.props.url) {
    //   window.dataHub.get(this.props.url, {}, (response) => {
    //     response.json().then((data) => {
    //       const datum = data[1][data[1].length - 1];
    //       this.setState({data: this.formatData(datum)});
    //     });
    //   });
    // }
  }

  calculatePartySeats() {
    const partyTotals = new Map();

    for (const prediction of this.state.data) {
      const win = prediction.win_17;

      if (!partyTotals.has(win)) {
        partyTotals.set(win, 0);
      }

      partyTotals.set(win, partyTotals.get(win) + 1);
    }

    return sortBy(Array.from(partyTotals.entries()), x => -x[1]);
  }

  render() {
    const partySeats = this.calculatePartySeats();

    return (
      <div className="prediction">
        <SeatDistribution
          colours={this.props.colours}
          names={this.props.names}
          partySeats={partySeats}
        />
        <ul className="summary">
          {partySeats.map(([party, seats], key) => (
            <li key={key}>
              <span className="colour" style={{backgroundColor: this.props.colours[party] || this.props.colours['oth']}}></span>
              {this.props.names[party] || 'Other'} {seats}
            </li>
          ))}
        </ul>
      </div>
    );
  }
}

Prediction.propTypes = {
  data: PropTypes.object,
  colours: PropTypes.object,
  url: PropTypes.string
};
